import React, { useState, useEffect } from 'react';
import { Typography, Button, Grid } from '@mui/material';
import MainCard from 'ui-component/cards/MainCard';
import { gridSpacing } from 'store/constant';
import axios from 'axios';

const CSB03 = () => {
    const [PData, setPData] = useState({
        P_name: '',
        P_details: '',
        P_status: '',
        P_CSB01: '',
        P_CSB02: '',
        P_CSB03: '',
        P_S1: '',
        P_S2: '',
        P_T: ''
    });

    const [project, setProject] = useState('');
    const [studentName, setStudentName] = useState('');
    const [teacherName, setTeacherName] = useState('');

    const handleRejectClick = () => {
        // Perform actions when the "Reject" button is clicked
    };

    const handleAcceptClick = () => {
        // Perform actions when the "Accept" button is clicked
    };

    useEffect(() => {
        const fetchData = async () => {
            try {
                const response = await axios.get('http://localhost:9999/Project');
                const data = response.data;

                // Assuming the API returns an array of projects and we want the first project
                if (Array.isArray(data) && data.length > 0) {
                    const project = data[0]; // Adjust based on actual API response
                    setPData({
                        P_name: project.P_name || '',
                        P_details: project.P_details || '',
                        P_status: project.P_status || '',
                        P_CSB01: project.P_CSB01 || '',
                        P_CSB02: project.P_CSB02 || '',
                        P_CSB03: project.P_CSB03 || '',
                        P_S1: project.P_S1 || '',
                        P_S2: project.P_S2 || '',
                        P_T: project.P_T || ''
                    });
                } else {
                    console.error('Unexpected API response:', data);
                }
            } catch (error) {
                console.error('Error fetching data:', error);
            }
        };

        fetchData();
    }, []);

    return (
        <MainCard>
            <Grid container spacing={gridSpacing}>
                <Grid item xs={12}>
                    <Grid container alignItems="center" justifyContent="space-between">
                        <Grid item>
                            <Grid container direction="column" spacing={1}>
                                <Typography variant="h1">การยื่นป้องกัน โครงงานพิเศษ 2
                                    <Typography variant="subtitle1">แบบฟอร์มยินยอมสอบป้องกันโครงงานพิเศษโครงการพิเศษ (สองภาษา) <br />ภาควิชาวิทยาการคอมพิวเตอร์และสารสนเทศ <br />คณะวิทยาศาสตร์ประยุกต์มหาวิทยาลัยเทคโนโลยีพระจอมเกล้าพระนครเหนือ<br />
                                        ข้าพเจ้ายินยอมสอบป้องกัน {project}<br />{studentName}<br />โดยมีอาจารย์ที่ปรึกษา {teacherName}
                                        <Grid container spacing={2}>
                                            <Grid item>
                                                <Button variant="contained" color="error" onClick={handleRejectClick}>
                                                    ปฏิเสธ
                                                </Button>
                                            </Grid>
                                            <Grid item>
                                                <Button variant="contained" color="success" onClick={handleAcceptClick}>
                                                    ยินยอม
                                                </Button>
                                            </Grid>
                                        </Grid>
                                    </Typography>
                                </Typography>
                            </Grid>
                        </Grid>
                    </Grid>
                </Grid>
            </Grid>
        </MainCard>
    );
};

export default CSB03;
